import React from 'react';

import MenuBar from '../components/MenuBar';
import MenuButton from '../components/MenuButton';

const MenuContainer = () => {
  return (
    <div className="menu-container">
      <MenuBar />
      <MenuButton />
    </div>
  );
};

export default MenuContainer;
